import request, { IResult } from "./utils";

export async function getMenuElements() {
  const requestURL =
    "http://localhost:1337/api/menu-items?populate[0]=cta1&populate[1]=cta2&populate[2]=submenu.*";
  try {
    let result: IResult = await request(requestURL, {
      method: "GET",
    });
    return result.data;
  } catch (e) {
    console.error(e);
  }
}
